import React from 'react'

function Resume() {
  const datas = window.localStorage.getItem('obj')
  const rData = JSON.parse(datas)
  return (
    <div className='container' class="resume">

      {/* <div className='row'> */}
        <div className='col-1' class>
         Name :-{rData.name} {rData.Lastname}
        </div>

        <div className='col-1'>
        Gmail:-  {rData.Gmail}
        </div>

        <div className='col-1'>
         Address:-{rData.Address}
        </div>

        <div className='col-1'>

        date of Birth:- {rData.DOB}
        </div>

        <div className='col-1'>

       Qualification:- {rData.Qualification}
        </div>

        <div className='col-1'>
         Skills:- {rData.Skills}
        </div>

        <div className='col-1'>
         MaritalStatus:-  {rData.MaritalStatus}
        </div>

        <div className='col-1'>
         Hobbies:- {rData.Hobbies}
        </div>

      {/* </div> */}

    </div> 
  )
}

export default Resume;
